nage attendee registration and ticket sales to your events, for free.'=>'Получите Event Tickets, чтобы бесплатно управлять регистрацией участников и продажей билетов на ваши мероприятия.','Advanced Google Maps functionality'=>'Расширенная функциональность карт Google',' Check out our <a href="%s" rel="noopener" target="_blank">customization guide</a> for instructions on template modifications.'=>' Ознакомьтесь с нашим <a href="%s" rel="noopener" target="_blank">руководством по настройке</a> для получения инструкций по модификации шаблона.','Default Styles'=>'Стили по умолчанию','Enter the format to use for displaying dates with the year. Used when showing an event from a future year. Example: %1$s'=>'Введите формат, который будет использоваться для отображения дат с годом. Используется при отображении мероприятия из будущего года. Пример: %1$s','Start selling tickets to your events'=>'Начните продавать билеты на свои мероприятия','The text label for the Day View.Day'=>'День','The text label for the List View.List'=>'Список','The text label for the Month View.Month'=>'Месяц','The default title text for the today button.Click to select today\'s date'=>'Нажмите, чтобы выбрать сегодняшнюю дату','The default text for the \'today\' button\'s title and aria-label on the Week View.Click to select the current month'=>'Щелкните для выбора текущего месяца','The default text label for the "today" button on main calendar views.Today'=>'Cегодня','The default text label for the "today" button on the Month View.This Month'=>'Этот месяц','Events that end after the specified date'=>'Мероприятия должны закончиться после определенной(указанной) даты','Events that end on the specified date'=>'Мероприятия заканчивающиеся на определённую дату','Events that start on the specified date'=>'Мероприятия должны начаться после определенной(указанной) даты','Text label for control to hide restricted events on main calendar views.Hide restricted events on calendar views.'=>'Скрыть мероприятия с ограниченным доступом в представлениях календаря.','Events that end before the specified date'=>'Мероприятия, которые заканчиваются до указанной даты','Dates set using the start_date/end_date, starts_*/ends_* are set to start at the specified times. The default behavior is to include the entire days.'=>'Даты, заданные с помощью start_date/end_date, starts_*/ends_*, устанавливаются так, чтобы начинаться в указанное время. Поведение по умолчанию включает все дни.','Need assistance? You can find more information here:'=>'Нужна помощь? Вы можете найти дополнительную информацию здесь:','Importing Calendar Data From a CSV File'=>'Импорт данных календаря из файла CSV','CSV File Formatting and Examples '=>'Форматирование и примеры файлов CSV ','Okay'=>'Хорошо','Download report'=>'Скачать отчет','Migration reversed'=>'Обратная миграция','Migration failure'=>'Сбой миграции','Your site could not be safely migrated to the new events system.'=>'Ваш сайт не удалось безопасно перенести в новую систему мероприятий.','We detected an event that cannot be properly migrated. Please review the report below for more information. This issue must be resolved before you can migrate your site. Once you have updated or removed the problematic event, re-run the migration preview to make sure your site is ready to go.'=>'Мы обнаружили событие, которое не может быть перенесено должным образом. Пожалуйста, просмотрите отчет ниже для получения дополнительной информации. Эта проблема должна быть решена до того, как вы сможете перенести свой сайт. После обновления или удаления проблемного мероприятия повторно запустите предварительный просмотр миграции, чтобы убедиться, что ваш сайт готов к работе.','Migration attempted'=>'Попытки миграции','Migration failed'=>'Миграция не удалась','View the error report'=>'Просмотреть отчет об ошибке','Ticket sales, RSVPs, event submissions, and automatic imports will be paused until migration is complete.'=>'Продажа билетов, RSVP, отправка заявок на мероприятия и автоматический импорт будут приостановлены до завершения миграции.','Ticket sales, RSVPs, and automatic imports will be paused until migration is complete.'=>'Продажа билетов, RSVP и автоматический импорт будут приостановлены до завершения миграции.','Event submissions and automatic imports will be paused until migration is complete.'=>'Отправка мероприятий и автоматический импорт будут приостановлены до завершения миграции.','Ticket sales, RSVPs, and event submissions will be paused until migration is complete.'=>'Продажа билетов, RSVP и подача заявок на участие в мероприятиях будет приостановлена до завершения миграции.','Ticket sales and RSVPs will be paused until migration is complete.'=>'Продажи билетов и RSVP будут приостановлены до завершения миграции.','Event submissions will be paused until migration is complete.'=>'Отправка мероприятий будет приостановлена до завершения миграции.','Automatic imports will be paused until migration is complete.'=>'Автоматический импорт будет приостановлен до завершения миграции.','One more thing left to do...'=>'Осталось сделать еще кое-что...','To complete this major calendar upgrade, you need to migrate your events to the new data storage system. Once migration finishes, you can take advantage of all the cool new 6.0 features!'=>'Чтобы завершить обновление календаря, необходимо перенести мероприятия в новую систему хранения данных. После завершения миграции вы сможете воспользоваться всеми новыми возможностями версии 6.0!','The Events Calendar: Custom Tables v1 - error'=>'Events Calendar: Custom Tables v1 - error','Number of events migrated%1$s%2$d%3$s events migrated'=>'%1$s%2$d%3$s мероприятий перенесено','Number of events previewed%1$s%2$d%3$s events previewed'=>'%1$s%2$d%3$s пред просмотр мероприятий','Number of events awaiting preview%1$s%2$d%3$s remaining'=>'%1$s%2$d%3$s осталось','Number of events awaiting migration%1$s%2$d%3$s remaining'=>'%1$s%2$d%3$s осталось','Retry'=>'Повторить','Cancel Migration'=>'Отмена миграции','Cancel Migration Preview'=>'Отменить пред просмотр миграции','Migration complete!'=>'Миграция завершена!','Your events are being migrated to the new system. During migration, %1$syou cannot make changes to your calendar or events.%2$s Your calendar will still be visible on the frontend.'=>'Ваши мероприятия переносятся в новую систему. Во время миграции %1$sy вы не сможете вносить изменения в календарь или мероприятия.%2$s Ваш календарь по-прежнему будет виден на фронтенде.','Your site is now using the upgraded event data storage system. Go ahead and %1$scheck out your events%2$s or %3$sview your calendar.%2$s'=>'Ваш сайт теперь использует обновленную систему хранения данных о мероприятиях. Перейдите к %1$sвыбору мероприятий%2$s или %3$sпросмотру календаря.%2$s','Migration completed'=>'Миграция завершена','Total events migrated:'=>'Всего мигрированных мероприятий:','Reverse migration'=>'Обратная миграция','Cancelation in progress'=>'Незавершенная отмена','We are canceling your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Мы отменяем переход вашего сайта на новую систему. В это время %1$sвы не сможете создавать, редактировать или управлять своими мероприятиями%2$s. Ваш календарь по-прежнему будет виден на вашем сайте, но некоторые действия на фронтенде будут приостановлены.','Cancelation complete.'=>'Отмена завершена.','Reverse migration complete.'=>'Обратная миграция завершена.','Reverse migration in progress'=>'Выполняется обратная миграция','Events can migrate with no changes!'=>'Мероприятия могут мигрировать без изменений!','The following %1$s will be migrated with no adjustments:'=>'Следующие объекты %1$s будут перенесены без корректировок:','The following %1$s have been migrated with no adjustments:'=>'Следующие %1$s были перенесены без корректировок:','Unknown strategy applied to this event.'=>'Неизвестная стратегия, примененная к этому мероприятию.','Migration help'=>'Помощь в миграции','We are reversing your site\'s migration to the new system. During this time, %1$syou cannot create, edit, or manage your events%2$s. Your calendar will still be visible on your site but some frontend actions will be paused.'=>'Мы отменяем переход вашего сайта на новую систему. В это время %1$sвы не сможете создавать, редактировать или управлять мероприятиями%2$s Ваш календарь по-прежнему будет виден на вашем сайте, но некоторые действия на фронтенде будут приостановлены.','We detected one or more events that cannot be properly migrated. Please review the report below for more information. These issues must be resolved before you can migrate your site. Once you have updated or removed problematic events, please re-run the migration preview.'=>'Мы обнаружили одно или несколько мероприятий, которые не могут быть перенесены должным образом. Пожалуйста, просмотрите отчет ниже для получения дополнительной информации. Эти проблемы должны быть решены до того, как вы сможете перенести свой сайт. После обновления или удаления проблемных мероприятий повторно запустите предварительный просмотр миграции.','The event %s generated an error: [%s]. Update the event and try again, or check out our %sTroubleshooting%s tips.'=>'Мероприятие %s вызвало ошибку: [%s]. Обновите событие и повторите попытку, или ознакомьтесь с нашими советами по устранению %s неполадок%s.','The event %s generated an error: Migration was canceled. Please try again.'=>'Мероприятие %s вызвало ошибку: Миграция была отменена. Попробуйте еще раз.','The event %s generated an error: The "die" or "exit" function was called during the migration process; output: %s. Please try again or check out our %sTroubleshooting%s tips.'=>'Мероприятие %s вызвало ошибку: В процессе миграции была вызвана функция "die" или "exit"; выход: %s. Пожалуйста, попробуйте еще раз или ознакомьтесь с нашими советами %s по устранению неполадок%s.','The event %s generated an error: [%s]. Please try again or check out our %sTroubleshooting%s tips.'=>'Мероприятие %s вызвало ошибку: [%s]. Пожалуйста, попробуйте еще раз или ознакомьтесь с нашими советами по устранению %s неполадок%s.','The event %s cannot be migrated because we do not yet support tickets on recurring events. Remove the tickets or wait to migrate until a path is available (%sRead more%s).'=>'Мероприятие %s не может быть перенесено, поскольку мы пока не поддерживаем билеты на повторяющиеся мероприятия. Удалите билеты или подождите с миграцией до тех пор, пока не будет доступен путь (%sЧитать далее%s).','The event %s generated an error: Cannot enqueue action to migrate Event with post ID %s. Your site may be under high load and unable to process the necessary requests. Try again later.'=>'Мероприятие %s вызвало ошибку: Невозможно поставить в очередь действие для переноса мероприятия с ID публикации %s. Возможно, ваш сайт перегружен и не может обработать необходимые запросы. Попробуйте позже.','The event %s generated an unknown error. Please try again or check out our %sTroubleshooting%s tips.'=>'Мероприятие %s сгенерировало неизвестную ошибку. Попробуйте повторить попытку или ознакомьтесь с нашими советами %s по устранению неполадок%s.','View the migration report'=>'Просмотреть отчет о миграции','Migration canceled'=>'Миграция отменена','The event %s generated an error: Cannot enqueue action to check migration status. Your site may be under high load and unable to process the necessary requests. Try again when site activity is low.'=>'Мероприятие %s вызвало ошибку: Невозможно поставить в очередь действие для проверки состояния миграции. Возможно, ваш сайт перегружен и не может обработать необходимые запросы. Повторите попытку, когда активность на сайте будет низкой.','(Estimated time: %1$s minute)'=>'(Приблизительное время: %1$s минута)','(Estimated time: %1$s minutes)'=>'(Приблизительное время: %1$s минут)','https://evnt.is/1b79'=>'https://evnt.is/1b79','Start migration'=>'Начать перенос','We\'ve completely revamped the way event information is stored on your site\'s database. Upgrade now to take advantage of faster calendar load times and improved performance. As with any significant site change, we recommend %screating a site backup%s before beginning the migration process.'=>'Мы полностью изменили способ хранения информации о мероприятиях в базе данных вашего сайта. Обновитесь сейчас, чтобы воспользоваться преимуществами более быстрой загрузки календаря и улучшенной производительности. Как и при любом значительном изменении сайта, перед началом процесса миграции мы рекомендуем %sсоздать резервную копию%s сайта.','Ready to go? The first step is a migration preview.'=>'Готовы к работе? Первый шаг - предварительный просмотр миграции.','We\'ll scan your events and let you know how long your migration will take. The preview runs in the background, so you\'ll be able to continue using your site.'=>'Мы просканируем ваши мероприятия и сообщим вам, сколько времени займет миграция. Предварительный просмотр проходит в фоновом режиме, поэтому вы сможете продолжать пользоваться своим сайтом.','Learn more about the migration'=>'Узнайте больше о миграции','Start migration preview'=>'Начать пред просмотр миграции','Migration preview in progress'=>'Выполняется пред просмотр миграции','We\'re scanning your existing events so you\'ll know what to expect from the migration process. You can keep using your site and managing events. Check back later for the next step of migration.'=>'Мы сканируем ваши существующие мероприятия, чтобы вы знали, чего ожидать от процесса миграции. Вы можете продолжать пользоваться своим сайтом и управлять мероприятиями. Загляните позже, чтобы узнать о следующем этапе миграции.','Preview complete'=>'Предварительный просмотр завершен','Preview completed'=>'Пред просмотр завершен','Total events previewed:'=>'Всего просмотренных мероприятий:','Migration in progress'=>'Выполняется миграция','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Предварительный просмотр миграции завершен и готов к просмотру. В ваши мероприятия не было внесено никаких изменений, но этот отчет показывает, какие корректировки будут внесены во время перехода на новую систему. Если у вас возникли вопросы, пожалуйста, %1$sобращайтесь в нашу службу поддержки%2$s.','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'По нашим оценкам, полный процесс миграции займет около %3$d минут. В течение этого времени %1$sy вы не сможете создавать, редактировать или управлять своими мероприятиями.%2$s Ваш календарь по-прежнему будет виден на вашем сайте.','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Ваша система не позволяет нам запустить предварительный просмотр, но вы все равно можете попробовать миграцию. Во время миграции %1$sy вы не сможете создавать, редактировать или управлять мероприятиями.%2$s Ваш календарь по-прежнему будет виден на вашем сайте.','Resources'=>'Ресурсы','unknown'=>'неизвестно','Plugins Page'=>'Страница плагинов','ID %1$d (Untitled)'=>'ID %1$d (без названия)','Re-run preview'=>'Пред просмотр повторного выпуска','Show past %1$s'=>'Показать прошедшие %1$s','Show more upcoming %1$s'=>'Показать больше предстоящих %1$s','Upgrade is not Available'=>'Обновление недоступно','You must update your version of Events Calendar Pro for access to calendar upgrades.'=>'Вы должны обновить свою версию Events Calendar Pro, чтобы получить доступ к обновлениям календаря.','Version Compatibility'=>'Совместимость версий','Upgrade FAQ'=>'FAQ по обновлению','To safely cancel the migration, we need to reverse the process on any data that has already been modified. Your site will remain in maintenance mode until we have safely reversed the process.'=>'Чтобы безопасно отменить миграцию, нам необходимо отменить процесс для всех данных, которые уже были изменены. Ваш сайт будет находиться в режиме обслуживания до тех пор, пока мы безопасно не отменим процесс.','Are you sure you want to reverse the recurring event system migration process?

- You will no longer be able to use the new recurring event and Series features.
- All event edits you have made since migration will be lost.
- As with migration, you will not be able to edit events or calendar options during this process and some frontend actions will be paused.
- Reverse migration should take less time than the original migration, but there is no time estimate available.
'=>'Вы уверены, что хотите отменить процесс миграции системы повторяющихся мероприятий?

- Вы больше не сможете использовать новые функции повторяющихся мероприятий и серий.
- Все правки мероприятий, сделанные вами после миграции, будут потеряны.
- Как и при миграции, во время этого процесса вы не сможете редактировать события или параметры календаря, а некоторые действия на фронтенде будут приостановлены.
- Обратная миграция должна занять меньше времени, чем первоначальная миграция, но приблизительных сроков пока нет.
','Get ready for the new recurring events!'=>'Будьте готовы к новым повторяющимся мероприятиям!','Upgrade your event data storage system.'=>'Модернизируйте систему хранения данных о мероприятиях.','The Events Calendar product suite logo'=>'Логотип набора продуктов Events Calendar','<strong>Check out your calendar to see the improved designs live on your site.</strong> If you have a question or need help, %1$s or %2$s.'=>'<strong>Проверьте свой календарь, чтобы увидеть улучшенный дизайн на своем сайте.</strong> Если у вас есть вопрос или вам нужна помощь, %1$s или %2$s.','Upgrade your events'=>'Улучшайте свои мероприятия','We’ve detected that your site was still using our legacy calendar design. As part of the update to The Events Calendar 6.0, <strong>your calendar was automatically upgraded to the new designs.</strong>'=>'Мы обнаружили, что на вашем сайте по-прежнему используется наш устаревший дизайн календаря. В рамках обновления Events Calendar 6.0 <strong>ваш календарь был автоматически обновлен до нового дизайна.</strong>','%s must be a valid HTML color code.'=>'%s должен быть действительным кодом цвета HTML.','Select Image'=>'Выбрать изображение','Remove Image'=>'Удалить изображение','Use this image'=>'Использовать это изображение','Duplicate events'=>'Дублирование мероприятий','Our support page for TECcontact support'=>'связаться с поддержкой','Recurring events & series'=>'Повторяющиеся мероприятия и серии','Read more about deprecation of legacy views.read the FAQs'=>'прочитайте FAQs','View your calendar'=>'Просмотреть свой календарь','Your calendar’s design has changed'=>'Дизайн вашего календаря изменился','Filter events with or without tickets.'=>'Фильтруйте мероприятия с билетами или без них.','Event Tickets plugin is not activated.'=>'Плагин Event Tickets не активирован.','Event Tickets REST API is not available.'=>'API REST Event Tickets недоступен.','Troubleshooting Page'=>'Страница поиска и устранения неисправностей','Add to calendar'=>'Добавить в к