parent (default).Transparent.'=>'Прозрачный.','Options selected here will override what was selected in the "Global Elements" section on Single Event views.'=>'Параметры, выбранные здесь, отменяют те, которые были выбраны в разделе "Глобальные элементы" в представлениях одиночных мероприятий.','A link telling users to disable an extension that may conflict.You are using the Inherit Theme Fonts extension. Font control is now built into %1$sThe Events Calendar\'s options in the WordPress Customizer.%2$s Please disable the Inherit Theme Fonts extension to prevent conflicts with The Events Calendar.'=>'Вы используете расширение Inherit Theme Fonts. Управление шрифтами теперь встроено в опции %1$sEvents Calendar в WordPress Customizer%2$s. Отключите расширение Inherit Theme Fonts, чтобы избежать конфликтов с Events Calendar.','The header for the color control section.Adjust Appearance'=>'Настройка внешнего вида','The Events Bar background color setting label.Background Color'=>'Цвет фона','The Events Bar icon color setting label.Icons'=>'Значки','The events bar text color setting label.Text Color'=>'Цвет текста','The Events Bar border color setting label.Border Color'=>'Цвет рамки','Label for the default option.Default'=>'По умолчанию','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Легко заполните свой календарь мероприятиями из Meetup, Eventbrite, iCal, Google Calendar и др.','Events Aggregator'=>'Events Aggregator','Events Bar'=>'Панель мероприятий','The "Find Events" button color setting label.Find Events Button Color'=>'Цвет кнопки Найти мероприятия','The "Find Events" button text color setting label.Find Events Button Text'=>'Текст кнопки Найти мероприятия','Import events with ease'=>'Легкий импорт мероприятий','Note about what these settings control.These settings control the search and options bar that appears above calendar views.'=>'Эти параметры управляют панелью поиска и параметров, которая 