ing “Page Not Found” on events.'=>'Я продолжаю получать "Страница не найдена" на мероприятиях.','My calendar doesn’t look right.'=>'Мой календарь не в порядке.','The #1 calendar for WordPress'=>'Календарь №1 для WordPress','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Импортируйте мероприятия из Meetup, Eventbrite, iCal, Google Calendar и других.','There are a few %s to resolve and prevent 404 errors.'=>'Существует несколько %s для устранения и предотвращения ошибок 404.','This can happen when other plugins try to improve performance. %s.'=>'Это может произойти, когда другие плагины пытаются повысить производительность. %s.','Check for updates'=>'Проверить обновления','Common Error Messages'=>'Общие сообщения об ошибках','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be compromised if your site is running outdated or mis-matched versions.'=>'Важно использовать самые последние версии наших плагинов, чтобы у Вас был доступ к последним функциям, исправлениям ошибок и обновлениям системы безопасности. Функциональность плагинов может быть нарушена, если на Вашем сайте используются устаревшие или несовместимые версии.','Enter a custom API key'=>'Введите собственный ключ API','Plugin(s) are out of date'=>'Плагин(ы) устарел(и)','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'Events Calendar поставляется с API-ключом для базовой функциональности карт. Если вы хотите использовать более продвинутые функции, такие как пользовательские булавки на карте, динамическая загрузка карты или поиск по местоположению и расширенный вид карты в Events Calendar Pro, вам необходимо получить собственный ключ Google Maps API и добавить его в Мероприятия > Настройки > Интеграции','Default Google Maps API key'=>'Ключ API Google Maps по умолчанию','Manage your licenses'=>'Управление лицензиями','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Лицензионные ключи можно использовать только на ограниченном количестве сайтов, которое зависит от уровня лицензии. Вам нужно будет удалить лицензию с одного или нескольких других сайтов, чтобы использовать ее на этом.','Adjust your timezone'=>'Настройка часового пояса','Install max has been reached'=>'Достигнуто макс. количество установок','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'При использовании Events Calendar мы настоятельно рекомендуем вам использовать географический часовой пояс, например "America/Los_Angeles", и избегать использования смещения часового пояса UTC, например "UTC+9". Выбор часового пояса UTC для вашего сайта или отдельных мероприятий может вызвать проблемы при импорте мероприятий или при переходе на летнее время. Перейдите к общим настройкам WordPress, чтобы настроить часовой пояс сайта.','Display Custom HTML'=>'Отображать собственный HTML','Hide Others’ Organizers and Venues'=>'Скрыть других организаторов и места проведения','Site time zone uses UTC'=>'Часовой пояс сайта использует UTC','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Это расширение добавляет флажки "Показывать карты Google" и "Показывать ссылку на карты Google" при создании нового места размещения.','This extension allows you to hide the Organizers and Venues that a visitor has not created from the Community submission form.'=>'Это расширение позволяет скрыть организаторов и места проведения мероприятий, которые посетитель не создал, из формы отправки мероприятия сообщества.','Add Cost Currency Symbol'=>'Добавить символ валюты стоимости','Add Event & Attendee Info to WooCommerce Order Details'=>'Добавить информацию о мероприятии и посетителе в сведения о заказе WooCommerce','Add Google Maps Display and Link Options'=>'Добавить параметры отображения Google Maps и ссылки','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Добавлена новая панель настроек в разделе "Мероприятия и Настройки", которая дает больше возможностей для контроля над ticket и "Просим ответить", которые отправляются участникам после регистрации.','Can I have a seating chart associated with my tickets?'=>'Могу ли я привязать схему рассадки к моим билетам?','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Отображает информацию, собранную "мета-полями посетителей", также на экранах заказов WooCommerce.','How do I process refunds for tickets?'=>'Как оформить возврат денег за билеты?','Per Event Check In API'=>'API регистрации каждого мероприятия','Organizer Notification Email'=>'Уведомление организатора по email','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'Как настроить плагины электронной торговли для продажи билетов?','Ticket Email Settings'=>'Настройки email для билетов','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Когда речь идет о платных билетах, эти заказы могут быть возвращены через используемую платформу электронной торговли.','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'Мы собрали видеоурок, в котором показано, как создавать мероприятия с билетами с помощью наших плагинов. Щелкните ссылку в ссылке в заголовке, чтобы узнать больше.','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Вы можете продавать билеты с помощью нашей встроенной опции электронной торговли или перейти на Event Tickets Plus, чтобы использовать плагины электронной коммерции, такие как WooCommerce.','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Да! Вы можете легко решить эту задачу, используя опции акций и несколько типов билетов, доступных в Event Tickets.','This extension will send an email to event organizers whenever a user registers for their event.'=>'Это расширение будет отправлять электронное письмо организаторам мероприятий всякий раз, когда пользователь регистрируется на их мероприятие.','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Это расширение позволяет вам устанавливать символы валют по умолчанию для выбора пользователями вместо обычного текстового поля.','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Это расширение показывает мета-блок с ключом API на каждом мероприятии с билетом/RSVP.','How Do I create events with Tickets or RSVP’s?'=>'Как мне создавать мероприятия с билетами или подтверждениями?','Alternative photo view'=>'Альтернативный показ фото','Calendar widget areas'=>'Области виджета календаря','Can I have more than one calendar?'=>'Можно ли иметь несколько календарей?','Event block patterns'=>'Паттерны блоков мероприятий','Help page?'=>'Страница помощи?','Hey there... did you check out the %s'=>'Привет... ты проверил %s','How do I sell tickets to events?'=>'Как я могу продавать билеты н