verrides, custom calendar CSS, or other code customizations to your calendar, those modifications will be overridden by the new designs.'=>'Если у вас есть какие-либо переопределения шаблонов, пользовательский календарь CSS или другие настройки кода в вашем календаре, эти изменения будут переопределены новыми дизайнами.','Existing calendar customizations will be overridden.'=>'Существующие настройки календаря будут переопределены.','Confirm your upgrade'=>'Подтвердите свое обновление','Step 1 of 2'=>'Шаг 1 из 2','Learn more about the upgrade'=>'Узнайте больше об обновлении','Start your upgrade'=>'Начните обновление','We\'ve redesigned all of the calendar views to give you and your users a better experience. Beyond a brand new look, we\'ve optimized every design for mobile and introduced key improvements for each view.'=>'Мы переработали все представления календаря, чтобы обеспечить вам и вашим пользователям лучший опыт. Помимо совершенно нового внешнего вида, мы оптимизировали каждый дизайн для мобильных устройств и представили ключевые улучшения для каждого представления.','Upgrade your calendar.'=>'Обновите свой календарь.','screenshot of updated calendar views'=>'снимок экрана с обновленными представлениями календаря','You\'re all set!'=>'Вы все готово!','Connect to Meetup'=>'Подключиться к Meetup','Step 2 of 2'=>'Шаг 2 из 2','Let\'s go!'=>'Приступим!','This is especially true if you have made any code customizations to your calendar.'=>'Это особенно верно, если вы сделали какие-либо настройки кода в своем календаре.','We recommend making this update on a %1$sstaging site%2$s.'=>'Мы рекомендуем сделать это обновление на промежуточном сайте s%1$s s%2$s.','Add me to the list'=>'Добавить меня в список','Go check out your new calendar designs! Each calendar view has been updated, so feel free to enable views you may not have been using. If necessary, you can revert back to the legacy calendar views in the Display tab of your Event Settings.'=>'Проверьте свои новые дизайны календаря! Каждый вид календаря был обновлен, поэтому не стесняйтесь включать представления, которые вы, возможно, не использовали. При необходимости вы можете вернуться к прежним представлениям календаря на вкладке «Отображение» в настройках мероприятий.','I\'m not ready'=>'Я не готов','A new look for The Events Calendar is here!'=>'Новый взгляд на Events Calendar здесь!','Themer\'s Guide'=>'Руководство Themer','link for connecting meetupConnect to Meetup'=>'Подключиться к Meetup','(do not override)'=>'(не переопределять)','Start date for Eventbrite Tickets is Required'=>'Требуется дата начала для билетов Eventbrite','Log into Meetup'=>'Войти в Meetup','Upgrade'=>'Обновление','Upgrade your calendar views'=>'Обновите представления календаря','Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. %1$s'=>'Выбор часового пояса UTC для вашего сайта или отдельных мероприятий может вызвать проблемы при импорте мероприятий или с переходом на летнее время. %1$s','Enable the Gutenberg block editor interface for creating events.'=>'Включите интерфейс редактора блоков Gutenberg для создания мероприятий.','Enable WordPress Custom Fields on events in the classic editor.'=>'Включите настраиваемые поля WordPress для мероприятий в классическом редакторе.','Import events directly from a public Eventbrite.com URL. Please note that only Live events (i.e. published events) can be imported via URL.'=>'Импортируйте мероприятия напрямую из общедоступного URL-адреса Eventbrite.com. Обратите внимание, что только живые мероприятия (т.е. опубликованные мероприятия) могут быть импортированы через URL.','Please log in to enable event imports from Meetup.'=>'Войдите в систему, чтобы включить импорт мероприятий из Meetup.','When using The Events Calendar, we recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “%2$s”.'=>'При использовании Events Calendar мы рекомендуем использовать географический часовой пояс, такой как «America / Los_Angeles», и избегать использования смещения часового пояса в формате UTC, например «%2$s».','Welcome to The Events Calendar!'=>'Добро пожаловать в Events Calendar!','To continue using The Events Calendar, please install the latest version of'=>'Чтобы продолжить использовать Events Calendar, установите последнюю версию','We recommend a 16:9 aspect ratio for featured images.'=>'Для рекомендуемых изображений мы рекомендуем соотношение сторон 16:9.','Powered by'=>'Работает на','And if you skip this, that\'s okay! %1$s will still work just fine.'=>'И если вы пропустите это, ничего страшного! %1$s все равно будет работать нормально.','The datepicker label when the range start is now.Now'=>'Сегодня','%s published privately.'=>'%s опубликовано как личное.','%s reverted to draft.'=>'%s переведено в черновик.','%s scheduled.'=>'%s запланировано.','Hi, %1$s! This is an invitation to help our %2$s community. If you opt-in, some data about your usage of %2$s will be shared with our teams (so they can work their butts off to improve). We will also share some helpful info on events management, WordPress, and our products from time to time.'=>'Привет, %1$s! Это приглашение помочь нашему сообществу %2$s. Если вы зарегистрируетесь, некоторые данные о вашем использовании %2$s будут переданы нашим командам (чтобы они могли улучшить свою работу). Мы также время от времени будем делиться полезной информацией об управлении мероприятиями, WordPress и наших продуктах.','The datepicker range definition when no events are found.Upcoming'=>'Предстоящие','Helpful Links:'=>'Полезные ссылки:','Privacy'=>'Политика конфиденциальности','Promoter All rights reserved.'=>'Промоутер Все права защищены.','Authorize Promoter'=>'Авторизуйтесь, промоутер','Please authorize to continue onboarding.'=>'Пожалуйста, авторизуйтесь для продолжения регистрации.','Sorry, unable to authenticate your site. Please contact Promoter support.'=>'Извините, не могу подтвердить подлинность вашего сайта. Пожалуйста, свяжитесь со службой поддержки.','You do not have access to authenticate this site.'=>'У вас нет доступа для аутентификации на этом сайте.','Promoter would like to sync with your site'=>'Промоутер хотел бы синхронизировать с вашим сайтом','Licenses for Multisites'=>'Лицензии на мультисайты','Expired license keys and subscriptions'=>'Истек срок действия лицензионных ключей и подписок','Moving your license keys'=>'Перемещение ваших лицензионных ключей','View and manage your license keys'=>'Просмотр и управление вашими лицензионными ключами','Why am I being told my license key is out of installs?'=>'Почему мне говорят, что мой лицензионный ключ не установлен?','We hope you love %1$s'=>'Мы надеемся, что вы любите %1$s','and'=>'и','Please log in to continue'=>'Войдите в систему, чтобы продолжить','Please log out and log back in as an admin account'=>'Выйдите из системы и снова войдите в систему под учетной записью администратора','Terms'=>'Термины','The associated field is required.( required )'=>'(обязательно)','In order to register a plugin license, you\'ll first need to %1$sdownload and install%2$s the plugin you purchased. You can download the latest version of your plugin(s) from %3$syour account\'s downloads page%4$s. Once the plugin is installed and activated on this site, the license key field will appear below.'=>'Для того чтобы зарегистрировать лицензию на плагин, вам сначала нужно %1$sскачать и установить%2$s приобретенный плагин. Вы можете загрузить последнюю версию плагина (ов) со страницы загрузок %3$syourse%4$s вашего аккаунта. После того как плагин будет установлен и активирован на этом сайте, ниже появится поле лицензионного ключа.','North Macedonia'=>'Северная Македония','If you\'ve purchased a premium add-on, you\'ll need to enter your license key here in order to have access to automatic updates when new versions are available.'=>'Если вы приобрели премиум-дополнение, вам нужно будет ввести здесь свой лицензионный ключ, чтобы иметь доступ к автоматическим обновлениям при появлении новых версий.','Select the date format used for elements with minimal space, such as in datepickers.'=>'Выберите формат даты, который будет использоваться для элементов с минимальным пространством, таких как инструмент выбора даты.','Compact date format'=>'Компактный формат даты','Action-based Logger'=>'Регистратор на основе действий','The Action Logger will dispatch any logging message using the "tribe_log" action writing, by default, to the PHP error log.'=>'Action Logger будет отправлять любое сообщение журнала с помощью действия "tribe_log", записывая его, по умолчанию, в журнал ошибок PHP.','There’s a new version of %1$s available, but your license is expired. You’ll need to renew your license to get access to the latest version. If you plan to continue using your current version of the plugin(s), be sure to use a compatible version of The Events Calendar. %2$s'=>'Доступна новая версия %1$s, но срок действия вашей лицензии истек. Вам необходимо продлить лицензию, чтобы получить доступ к последней версии. Если вы планируете продолжать использовать текущую версию плагина(ов), убедитесь, что вы используете совместимую версию Events Calendar. %2$s','Read more.'=>'Читать далее.','Confirm'=>'Подтвердить','Open the modal window'=>'Откройте модальное окно','Close this modal window'=>'Закрыть это диалоговое окно','Open the dialog window'=>'Откройте диалоговое окно','State'=>'Округ/Область','PHP Render Context'=>'PHP Render Context','Key'=>'Ключ','Value'=>'Значение','ORM arg'=>'ORM arg','Reads'=>'Читает','Writes'=>'Пишет','Your update failed due to an incompatibility between the version (%1$s) of the %2$s you tried to update to and the version of %3$s that you are using. %4$s'=>'Обновление не выполнено из-за несовместимости между версией (%1$s) %2$s, которую вы пытались обновить, и версией %3$s, которую вы используете. %4$s','OK'=>'ОК','%s must be a valid URL.'=>'%s должен быть правильным URL.','Close this dialog window'=>'Закрыть это диалоговое окно','Could not delete post with ID '=>'Не удалось удалить запись с ID ','Promoter'=>'Промоутер','Show Timezone'=>'Показать часовой пояс','Event Organizer'=>'Организатор мероприятия','Tags'=>'Теги','Event Venue'=>'Место проведения мероприятия','Event Categories'=>'Рубрики мероприятий','All day'=>'Весь день','Show Map'=>'Показать карту','Enable Maps'=>'Разрешить Карты','Show Map Link:'=>'Показать ссылку на карту:','Show Map:'=>'Показать карту:','Add Description...'=>'Добавить описание...','F j'=>'F j','F j, Y'=>'F j, Y','%s ago'=>'%s назад','%s from now'=>'%s от этого момента','Problem loading the block, please remove this block to restart.'=>'Проблема при загрузке блока, пожалуйста, удалите этот блок для перезагрузки.','Text Array'=>'Текстовый массив','Numeric Array'=>'Числовой массив','Add Button Text'=>'Добавьте текст кнопки','Event Organizers'=>'Организаторы мероприятия','(click here for details)'=>'(нажмите здесь для подробностей)','Activate Block Editor for Events'=>'Активировать редактор блоков для мероприятий','Event Blocks'=>'Блоки мероприятия','There was an error building the record queue: '=>'Ошибка при построении очереди записей: ','Unknown Column '=>'Неизвестный столбец ','g:i a'=>'H:i','Show Custom Fields metabox'=>'Показать метабокс пользовательских полей','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Процесс асинхронного импорта быстрее и не полагается на WordPress Cron но может не работать корректно на всех WordPress установках, попробуйте процесс Cron-based для максимальной совместимости.','Stop current processes'=>'Остановить текущие процессы','If you want to stop and clear current asynchronous import processes %1$s.'=>'Если Вы хотите остановить и очистить текущие асинхронные процессы импорта %1$s.','Import Process System'=>'Система процессов импорта','click here'=>'нажмите здесь','to create your own free Google Maps API key.'=>'создать свой бесплатный Google Maps API ключ.','Import from Eventbrite URL'=>'Импорт из URL-адреса Eventbrite','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Если вы не добавите свой собственный ключ API, встроенный ключ API всегда будет заполнять это поле, и некоторые функции, связанные с картой, будут ограничены ','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Вы используете встроенный ключ Google Maps API в Events Calendar.','You are using a custom Google Maps API key.'=>'Вы используете собственный ключ API Карт Google.','Asynchronous'=>'Асинхронный','Cron-based'=>'На основе Cron','No asynchronous queue processes to clear.'=>'Процессы асинхронной очереди для очистки отсутствуют.','Unsupported'=>'Не поддерживается','Successfully stopped and cleared 1 asynchronous queue process.'=>'Успешно остановлен и очищен 1 процесс асинхронной очереди.' . "\0" . 'Успешно остановлено и очищено %d процесса асинхронной очереди.' . "\0" . 'Успешно остановлено и очищено %d процессов асинхронной очереди.','to learn more about using it with The Events Calendar'=>'чтобы узнать больше об использовании его с Events Calendar','Events should be filtered by their post_parent being the specified one.'=>'Мероприятия должны быть отфильтрованы по заданному post_parent.','Include events with one of the post IDs specified in the array of CSV list, date filters will be ignored.'=>'Включает мероприятия с одним из IDs записи, указанных в массиве списка CSV, фильтры дат игнорируются.','The event category ID or name'=>'ID или название категории мероприятия','The event tag ID or name'=>'ID или название тега мероприятия','Unable to process this import - a breakage or conflict may have resulted in the import halting.'=>'Невозможно обработать этот импорт - остановка импорта могла быть вызвана поломкой или конфликтом.','%s Search and Views Navigation'=>'Поиск и просмотр %s навигации','If you have extended our plugin(s) to send data to a third-party service such as Eventbrite, Google Maps, or PayPal, user information may be passed to these external services. These services may be located abroad.'=>'Если вы расширили наши плагины для отправки данных сторонним службам, таким как Eventbrite, Google Maps или PayPal, информация о пользователях может быть передана этим внешним службам. Эти услуги могут быть расположены за границей.','Calendar of %s'=>'Календарь %s','%s Views Navigation'=>'%s просмотров навигации','Certain data may be exported or removed upon users’ requests via the existing Exporter or Eraser. Please note, however, that several “edge cases” exist in which we are unable to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Некоторые данные могут быть экспортированы или удалены по запросу пользователей через существующего Экспортера или Ластика. Однако обратите внимание, что существует несколько «крайних случаев», в которых мы не можем улучшить сбор и экспорт всех данных для ваших конечных пользователей. Мы предлагаем выполнить поиск в вашей локальной базе данных, а также в панели управления WordPress, чтобы идентифицировать все данные, собранные и сохраненные для ваших конкретных пользовательских запросов.','Where We Send Your Data'=>'Куда мы отправляем ваши данные','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Вся информация (данные) хранится в локальной базе данных на неопределенный срок, если не удалено иное.','How Long You Retain this Data'=>'Как долго вы храните эти данные','We make use of certain APIs, in order to provide specific features.'=>'Мы используем определенные ключи API для предоставления определенных функций.','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'Пакет Events Calendar предлагает использование API-ключей сторонних производителей. В основном они используются для расширения встроенных функций, некоторые из которых используют Google Maps, PayPal, Eventbrite и Meetup. Эти API-ключи не предоставляются Events Calendar.','API Keys'=>'API-ключи','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'При покупке билетов на Eventbrite информация о посетителях, покупателях и заказах сохраняется и управляется Eventbrite.','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Обратите внимание, что для создания новых мероприятий с помощью формы отправки мероприятий сообщества пользователь должен иметь учетную запись на этом домене. Эта информация сохраняется в локальной базе данных. Также возможно создавать мероприятие анонимно, если у владельца сайта включена эта опция.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Информация о Eventbrite Ticket: название, описание, стоимость, тип, количество','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Импортировать данные о происхождении (URL-адрес, из которого импортируются мероприятия - например, Eventbrite, MeetUp, другие совместимые источники URL-адресов и т. Д., Которые могут включать аналогичные или те же данные, что указаны выше)','Organizer information: name, phone, website, email'=>'Информация об организаторе: имя, телефон, сайт, email','Event information: website, cost, description, date, time, image'=>'Информация о мероприятии: сайт, стоимость, заголовок, время, изображения','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Все данные, представленные в файле CSV или ICS и внешних URL-адресах (для мероприятий, мест, организаторов и билетов)','Suggested text:'=>'Предлагаемый текст:','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Если вы создаете, отправляете, импортируете, сохраняете или публикуете информацию о мероприятии, месте проведения или организаторе, такая информация сохраняется в локальной базе данных:','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Информация о месте проведения: название, адрес, город, страна, штат (область), почтовый индекс, телефон, веб-сайт, географические координаты (широта и долгота)','Importing Events, Venues, and Organizers:'=>'Импортирование мероприятий, мест и организаторов:','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within your website’s database.'=>'Благодаря использованию плагинов Events Calendar, Events Calendar PRO, Events Calendar Filter Bar, Eventbrite Tickets и Community Events, а также нашей услуги Event Aggregator Import (содержащейся в плагине Events Calendar), информация может собираться и храниться в базе данных вашего сайта.','Hello,'=>'Здравствуйте,','None'=>'Нет','Import from Eventbrite'=>'Импорт из Eventbrite','Learn more'=>'Узнать больше','Do more with Eventbrite Tickets'=>'Делайте больше с билетами на Eventbrite','What personal data we collect and why we collect it'=>'Какие персональные данные мы собираем и зачем мы их собираем','Disclaimer:'=>'Отказ от ответственности:','Event, Venue, and Organizer Information'=>'Информация о мероприятии, месте проведения и организаторах','Eventbrite Import Settings'=>'Настройки импорта Eventbrite','An event having a post meta value of `%s` hour (12-hour) is not valid. Make sure it is from 1 to 12.'=>'Мероприятия, имеющее значение post meta `%s` час (12 часов), недействительно. Убедитесь, что это значение от 1 до 12.','An event having a post meta value of `%s` hour (24-hour) is not valid. Make sure it is from 0 to 23.'=>'Мероприятие, имеющее значение post meta `%s` час (24 часа), недействительно. Убедитесь, что это значение от 0 до 23.','An event having a post meta value of `%s` hour (am/pm) is not valid. Make sure it is from 1 to 12.'=>'Мероприятие, имеющее значение post meta `%s` час (am/pm), недействительно. Убедитесь, что это значение от 1 до 12.','An event having a post meta value of `%s` minutes is not valid. Make sure it is from 0 to 59.'=>'Мероприятие, имеющее значение post meta `%s` минут, недействительно. Убедитесь, что значение от 0 до 59.','An event having a post meta value of `%s` meridian is not valid. Make sure it is either `am` or `pm`, or remove it entirely if using the 24-hour format.'=>'Мероприятие, имеющее значение post meta `%s` меридиана, недействительно. Убедитесь, что это `am` или `pm`, или удалите его совсем, если используется 24-часовой формат.','You should include the information below in the correct sections of you privacy policy.'=>'Вы должны включить приведенную ниже информацию в соответствующие разделы вашей политики конфиденциальности.','The default event category for events imported via Eventbrite'=>'Категория мероприятия по умолчанию для мероприятий, импортированных через Eventbrite','The default post status for events imported via Eventbrite'=>'Статус записи по умолчанию для мероприятий, импортированных через Eventbrite','This information is only for guidance and not to be considered as legal advice.'=>'Данная информация предназначена только для ознакомления и не должна рассматриваться как юридическая консультация.','This information serves as a guide on what sections need to be modified due to usage of The Events Calendar and its Add-ons.'=>'Эта информация служит в качестве руководства о том, какие разделы необходимо изменить в связи с использованием Events Calendar и его дополнений.','Connect to Eventbrite'=>'Соединение с Eventbrite','Settings > General'=>'Настройки > Общие','Refresh your connection to Eventbrite'=>'Обновите ваше соединение с Eventbrite','You need to connect to Eventbrite for Event Aggregator to work properly'=>'Вам нужно подключиться к Eventbrite, чтобы Event Aggregator работал правильно','to change how the actual time is displayed on your calendar.'=>'изменить, как фактическое время отображается в вашем календаре.','Limited connectivity with Eventbrite'=>'Ограниченная связь с Eventbrite','link for connecting eventbriteConnect to Eventbrite'=>'Подключиться к Eventbrite','Invalid Meetup URL'=>'Неверный URL-адрес Meetup','Import Source'=>'Источник импорта','eventbrite.com/e/example-12345'=>'eventbrite.com/e/example-12345','Log into Eventbrite'=>'Войти в Eventbrite','Import from your Eventbrite account'=>'Импорт из вашей учетной записи Eventbrite','Invalid Facebook URL'=>'Неверный URL-адрес Facebook','Invalid Eventbrite URL'=>'Неверный URL-адрес Eventbrite','Import events directly from your connected Eventbrite.com account or from a public Eventbrite.com URL.'=>'Импортируйте мероприятия непосредственно из вашего подключенного аккаунта Eventbrite.com или из публичного URL-адреса Eventbrite.com.','Please log in to enable event imports from Eventbrite.'=>'Войдите в систему, чтобы включить импорт мероприятий из Eventbrite.','The number of events available in the preview may be limited by your %1$sImport Settings.%2$s'=>'Количество мероприятий, доступных в предварительном просмотре, может быть ограничено вашими настройками импорта %1$s. %2$s','Use the filters to narrow down which events are fetched from Eventbrite.'=>'Используйте фильтры, чтобы определить, какие мероприятия выбираются из Eventbrite.','You have not connected Event Aggregator to Eventbrite'=>'Вы не подключили Event Aggregator к Eventbrite','Select Source'=>'Выберите источник','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Eventbrite on a set schedule. Single events can be added via a one-time import.'=>'Одноразовый импорт включает все текущие мероприятия, а импорт по расписанию автоматически захватывает новые мероприятия и обновления из Eventbrite по заданному расписанию. Единичные мероприятия могут быть добавлены с помощью одноразового импорта.','timezone settings'=>'настройки часового пояса','Events will be imported with the same timezone as defined on eventbrite.com. You can make use of The Events Calendar\'s'=>'Мероприятия будут импортированы с тем же часовым поясом, который указан на eventbrite.com. Вы можете использовать Events Calendar','Please provide a Eventbrite URL when importing from Eventbrite.'=>'Укажите URL Eventbrite при импорте из Eventbrite.','Events cannot be imported because Eventbrite has returned an error. This could mean that the event ID does not exist, the event or source is marked as Private, or the event or source has been otherwise restricted by Eventbrite. You can <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">read more about Eventbrite restrictions in our knowledgebase</a>.'=>'Мероприятия не могут быть импортированы, потому что Eventbrite выдал ошибку. Это может означать, что ID мероприятия не существует, мероприятие или источник помечены как частные, или мероприятие, или источник были ограничены Eventbrite. Вы можете <a href="https://theeventscalendar.com/knowledgebase/import-errors/" target="_blank">прочитать больше об ограничениях Eventbrite в нашей базе знаний</a>.','No upcoming Eventbrite events found.'=>'Предстоящих мероприятий Eventbrite не найдено.','Successfully fetched Eventbrite Token'=>'Успешно получен токен Eventbrite','The new status message for the user, not localized.'=>'Новое сообщение о статусе для пользователя, не локализовано.','The new status of the import.'=>'Новый статус импорта.','The current interval, in seconds, between the end of a batch process and the start of the next; as set on the server.'=>'Текущий интервал в секундах между окончанием пакетного процесса и началом следующего; как установлено на сервере.','The percentage of import completed.'=>'Процент импорта завершен.','The current status of the import.'=>'Текущий статус импорта.','The hash of the next expected batch, as previously provided by the client'=>'Хеш следующей ожидаемой партии, как ранее предоставлено клиентом','Read more'=>'Читать далее','The import unique ID as provided by Event Aggregator service'=>'Уникальный ID импорта, предоставленный службой Event Aggregator','The new status message slug, to allow for localized messages.'=>'Новый slug сообщения о статусе, позволяющий использовать локализованные сообщения.','There is an JSON error with the Event Aggregator server. Please try your import again later.'=>'Произошла ошибка JSON на сервере Event Aggregator. Попробуйте выполнить импорт позже.','2018 user survey<strong>The Events Calendar Annual Survey:</strong> share your feedback with our team—%1$s!'=>'<strong>Ежегодный опрос Events Calendar:</strong> поделитесь своим отзывом с нашей командой – %1$s!','2018 user surveytake the survey now'=>'принять участие в опросе сейчас','Search our support help desk'=>'Поиск в нашей службе поддержки','Every %d Minutes'=>'Каждые %d минут','in human readable timeretrying in about %s'=>'повторная попытка через %s','one week'=>'одна неделя','when the retry will happen, a dateretrying at %s'=>'повторная попытка будет %s','one month'=>'один месяц','The requested page was not found.'=>'Запрашиваемая страница не найдена.','3 years'=>'3 года','2 years'=>'2 года','1 year'=>'1 год','9 months'=>'9 месяцев','6 months'=>'6 месяцев','3 months'=>'3 месяца','Move to trash events older than'=>'Перемещать в корзину мероприятия старше, чем','Permanently delete events older than'=>'Удалять навсегда мероприятия, старше','Time Zone:'=>'Часовой пояс:','This option allows you to automatically move past events to trash.'=>'Эта настройка позволяет перемещать прошедшие мероприятия в корзину.','This option allows you to bulk delete past events. Be careful and backup your database before removing your events as there is no way to reverse the changes.'=>'Эта настройка позволяет выполнять массовое удаление прошедших мероприятий. Будьте осторожны и выполните резервное копирование перед удалением, так как это удаление необратимо.','Looks like you are using Gutenberg on this WordPress installation. %1$s'=>'Похоже, вы используете Гутенберга в этой установке WordPress. %1$s','Download our Events Gutenberg extension and start using the block editor on your events!'=>'Загрузите наше расширение Events Gutenberg и начните использовать редактор блоков на своих мероприятиях!','Customizer static front page settingMain %s Page'=>'Главная страница %s','An organizer with the specified event does not exist.'=>'Организатор с указанным мероприятием не существует.','The "/page/" URL string component.page'=>'страница','An event with the specified ID does not exist.'=>'Мероприятие с указанным ID не существует.','The number of events per page on the List View. Does not affect other views.'=>'Количество мероприятий на страницу в представлении списка. Не влияет на другие виды.','The event with the specified ID is not accessible.'=>'Мероприятие с указанным ID недоступно.','The organizer with the specified ID is not accessible.'=>'Организатор с указанным ID недо