ии места (часовой пояс UTC)','The venue publication date'=>'Дата публикации места','Event Aggregator will try to fetch %s events starting from the current date or the specified date;'=>'Event Aggregator будет пытаться получить мероприятия %s, начиная с текущей даты или указанной даты;','iCal feed descriptionEvents for %s'=>'Мероприятия для %s','Limit the number of imported events by number, date range, or not at all; on slower websites this may impact the success of imports. Selecting a shorter time period or a smaller number of events may improve results.'=>'Ограничить количество импортируемых мероприятий по номеру, диапазону дат или совсем не ограничивать; на более медленных сайтах это может повлиять на успех импорта. Выбор более короткого периода времени или меньшего количества мероприятий может улучшить результаты.','The organizer could not be deleted'=>'Организатор не может быть удален','The event is already trashed'=>'Мероприятие уже в корзине','The organizer could not be created from the provided data'=>'Организатор не может быть создан на основе предоставленных данных','The event could not be deleted'=>'Мероприятие не может быть удалено','The event could not be updated'=>'Мероприятие не может быть обновлено','The organizer is already trashed'=>'Организатор уже в корзине','The venue description'=>'Описание места проведения','The venue state and province'=>'Штат и область места проведения','The venue with the specified ID could not be deleted.'=>'Место с указанным ID не может быть удалено.','The venue author ID'=>'ID автора места проведения','The venue could not be created from the provided data'=>'Место проведения не может быть создано на основе предоставленных данных','The venue could not be deleted'=>'Место проведения не может быть удалено','The venue could not be updated'=>'Место проведения не может быть обновлено','The venue is already trashed'=>'Место проведения уже в корзине','the venue post name'=>'название записи места проведения','The venue post status'=>'Статус записи места проведения','The requested event term archive page does not exist'=>'Запрашиваемая страница архива терминов мероприятий не существует','The requested organizer is not accessible'=>'Запрашиваемый организатор недоступен','The provided linked post ID is not valid'=>'Указанный ID связанного сообщения недействителен','When importing from an event source, this is how far into the future the events will be fetched; on slower websites a larger date range may impact the success of imports. Selecting a shorter time period may improve results.'=>'При импорте из источника мероприятия это то, как далеко в будущем мероприятия будут выбраны; на более медленных сайтах увеличение диапазона дат может повлиять на успех импорта. Выбор более короткого периода времени может улучшить результаты.','Whether events linked to the venue should show a map link or not'=>'Должны ли мероприятия, связанные с местом проведения, отображать ссылку на карту или нет','Whether events linked to the venue should show a map or not'=>'Должны ли мероприятия, связанные с местом проведения, отображаться на карте','The requested venue archive page does not exist'=>'Запрашиваемая страница архива места не существует','The venue with the specified ID has been deleted already.'=>'Место с указанным ID уже удалено.','The requested venue is not accessible'=>'Запрашиваемое место не является доступным','the venue post ID'=>'id записи места проведения','The event end date and time'=>'Время и дата конца мероприятия','The event start date and time'=>'Время и дата начала мероприятия','The event time zone'=>'Часовая зона мероприятия','Find an Organizer'=>'Найти организатора','Create or Find an Organizer'=>'Создать или найти организатора','click here to edit it'=>'нажмите что бы отредактировать','By date range'=>'По диапазону дат','Deletes a venue and returns its data'=>'Удаляет место и возвращает его данные','The user is not authorized to create venues'=>'Пользователь не авторизован для создания мес