 Calendar and see those changes reflected on your site’s calendar. The owner of the original event source (e.g. the iCalendar feed or Meetup group) might also make changes to their event. If you choose to re-import an altered event (manually or via a scheduled import), any changes made at the source or on your calendar will need to be addressed.'=>'Вы можете вносить изменения в импортированные мероприятия через Events Calendar и видеть, как эти изменения отражаются в календаре вашего сайта. Владелец исходного источника мероприятия (например, feed iCalendar или группа Meetup) также может вносить изменения в свое мероприятие. Если вы решите повторно импортировать измененное мероприятие (вручную или через запланированный импорт), все изменения, сделанные в источнике или в вашем календаре, должны быть учтены.','Upload'=>'Загрузить','No'=>'Нет','Choose File'=>'Выбрать файл','No file chosen'=>'Не выбран файл','facebook.com/example'=>'facebook.com/example','https://calendar.google.com/calendar/ical/example/basic.ics'=>'https://calendar.google.com/calendar/ical/example/basic.ics','meetup.com/example'=>'meetup.com/example','Preview'=>'Предпросмотр','Choose File:'=>'Выбрать файл:','Change Event Update Authority'=>'Изменить полномочия обновления мероприятий','Choose a CSV file'=>'Выберите файл CSV','Content Type:'=>'Тип содержимого:','Copy the provided url into this field to import the events into your WordPress site.'=>'Скопируйте предоставленный url в это поле, чтобы импортировать мероприятия на ваш сайт WordPress.','Enter an Eventbrite event URL, e.g. https://www.eventbrite.com/e/example-12345'=>'Введите URL-адрес мероприятия Eventbrite, например, https://www.eventbrite.com/e/example-12345','Enter the url for a Meetup group, page, or individual. You can also enter the url of a single Meetup event.'=>'Введите URL-адрес группы, страницы или отдельного участника Meetup. Можно также ввести url отдельного мероприятия Meetup.','Enter the url for a Facebook group or page. You can 