юбыми изменениями из источника.','Please log in to enable event imports from Facebook.'=>'Войдите в систему, чтобы включить импорт мероприятий из Facebook.','Specify the type of content you wish to import, e.g. events.'=>'Укажите тип содержимого, которое вы хотите импортировать, например, мероприятия.','Use global import settings'=>'Использовать глобальные настройки импорта','Use the filters to narrow down which events are fetched from this Google Calendar.'=>'Используйте фильтры, чтобы сузить список мероприятий, выбираемых из этого Календаря Google.','Use the filters to narrow down which events are fetched from your ICS file.'=>'Используйте фильтры, чтобы сузить круг мероприятий, извлекаемых из вашего файла ICS.','Use the filters to narrow down which events are fetched from this iCalendar feed.'=>'Используйте фильтры, чтобы сузить круг мероприятий, получаемых из этой feed iCalendar.','You can find the url you need in your Google Calendar settings.'=>'Вы можете найти нужный URL в настройках вашего Календаря Google.','Select Frequency'=>'Выбрать периодичность','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Facebook on a set schedule. Single events can be added via a one-time import.'=>'Одноразовый импорт включает все текущие мероприятия, а импорт по расписанию автоматически захватывает новые мероприятия и обновления из Facebook по заданному расписанию. Единичные мероприятия могут быть добавлены с помощью одноразового импорта.','One-time imports include all currently listed events, while scheduled imports automatically grab new events and updates from Meetup on a set schedule. Single events can be added via a one-time import.'=>'Одноразовый импорт включает все текущие мероприятия, а импорт по расписанию автоматически захватывает новые мероприятия и обновления из Meetup по установленному графику. Единичные мероприятия можно добавить с помощью одноразового импорта.','One-Time Import'=>'Одноразовый импорт','One-time imports include all events in the current feed, while scheduled imports automatically grab new events and updates from the feed on a set schedule.'=>'Одноразовый импорт включает все мероприятия в текущей feed, а импорт по расписанию автоматически захватывает новые мероприятия и обновления из feed по заданному расписанию.','Scroll down to Calendar Address and click the iCal button (note: if your calendar is private, you\'ll need to click the iCal button next to the Private Address header instead).'=>'Прокрутите вниз до «Адрес календаря» и нажмите кнопку iCal (примечание: если ваш календарь является частным, вам нужно будет вместо этого нажать кнопку iCal рядом с заголовком «Частный адрес»).','Select how often you would like events to be automatically imported.'=>'Выберите, как часто вы хотите, чтобы мероприятия автоматически импортировались.','Select your .CSV file from the WordPress media library. You may need to first upload the file from your computer to the library.'=>'Выберите файл .CSV из медиатеки WordPress. Возможно, вам придется сначала загрузить файл с вашего компьютера в библиотеку.','Select your ICS file from the WordPress media library. You may need to first upload the file from your computer to the library.'=>'Выберите файл ICS из медиатеки WordPress. Возможно, вам придется сначала загрузить файл с вашего компьютера в библиотеку.','This event will not be re-imported and changes made locally will be preserved.'=>'Это мероприятие не будет повторно импортировано, а изменения, сделанные локально, будут сохранены.','Source:'=>'Источник:','Source'=>'Источник','Last Import'=>'Последнее импортирование','Restore &#8220;%s&#8221; from the Ignored'=>'Восстановить &#8220;%s&#8221; из игнорируемых','Restore'=>'Восстановить','Delete &#8220;%s&#8221; permanently'=>'Удалить &#8220;%s&#8221; без возможности восстановления','Ignored <span class="count">(%s)</span>'=>'Игнорируется: <span class="count">(%s)</span>' . "\0" . 'Игнорируется: <span class="count">(%s)</span>' . "\0" . 'Игнорируется: <span class="count">(%s)</span>','%s post restored.'=>'Запись %s восстановлена.' . "\0" . 'Записи %s восстановлены.' . "\0" . 'Записей %s восстановлены.','Error restoring from Ignored Events.'=>'Ошибка восстановления из игнорируемых мероприятий.','Error, a unknown bug happened and it was impossible to migrate the Legacy Ignored Events, try again later.'=>'Ошибка, произошла неизвестная ошибка, и было невозможно перенести устаревшие игнорируемые мероприятия, повторите попытку позже.','Event Aggregator includes a new, better system for removing unwanted imported events from your calendar. Click the button below to transition previously deleted events. This process will remove unwanted records from your database and include recent or upcoming trashed events in your Ignored archive.'=>'Event Aggregator включает новую, более совершенную систему удаления нежелательных импортированных мероприятий из вашего календаря. Нажмите кнопку ниже, чтобы перенести ранее удаленные мероприятия. Этот процесс удалит ненужные записи из вашей базы данных и включит недавние или предстоящие удаленные мероприятия в ваш архив игнорируемых мероприятий.','Abbreviation for the kilometers unit of measurekm'=>'км','Abbreviation for the miles unit of measuremi'=>'миля','Migrate Legacy Ignored Events'=>'Перенос унаследованных игнорируемых мероприятий','link to knowlegebase articleRead more about Ignored Events.'=>'Подробнее об игнорируемых мероприятиях.','The last time this event was imported and/or updated via import.'=>'Последний раз это мероприятие было импортировано и / или обновлено посредством импорта.','You do not have permission to migrate Legacy Ignored Events'=>'У вас нет разрешения на перенос устаревших игнорируемых мероприятий','Migration: %d Legacy Ignored Post was migrated successfully. To see the migrated event you will first need to refresh this screen.'=>'Миграция: %d устаревшая проигнорированная запись было успешно перенесена. Чтобы у