rted.'=>'Записи импорта должны быть завершены до того, как можно будет вставить записи.','Imported Event'=>'Мероприятие импортировано','Please continue to wait while your preview is generated.'=>'Подождите, пока будет создан предварительный просмотр.','Removing this scheduled import will stop automatic imports from the source. No events will be deleted.'=>'Удаление этого запланированного импорта прекратит автоматический импорт из источника. Никакие мероприятия не будут удалены.','The CSV file cannot be found. You may need to re-upload the file.'=>'CSV-файл не может быть найден. Вам может потребоваться повторная загрузка файла.','There was an error fetching the results from your import:'=>'Ошибка при получении результатов импорта:','Success! The settings from Facebook Events have been migrated to Event Aggregator. You can view your migrated imports on the Scheduled Imports tab.'=>'Успех! Настройки из Facebook Events были перенесены в Event Aggregator. Вы можете просмотреть перенесенные импорты на вкладке Запланированные импорты.','Success! The settings from iCal Importer have been migrated to Event Aggregator. You can view your migrated imports on the Scheduled Imports tab.'=>'Успех! Настройки из iCal Importer были перенесены в Event Aggregator. Вы можете просмотреть перенесенные импорты на вкладке Запланированные импорты.','Thanks for activating Event Aggregator! It looks like you have some settings and imports configured on our legacy importer plugins. To complete your transition, we need to transfer those options to our new system.'=>'Спасибо за активацию Event Aggregator! Похоже, что у вас есть некоторые параметры и импорт, настроенные на наших старых плагинах-импортерах. Чтобы завершить ваш переход, нам необходимо перенести эти параметры в нашу новую систему.','The preview is taking longer than expected. Please try again in a moment.'=>'Предварительный просмотр занимает больше времени, чем ожидалось. Повторите попытку через некоторое время.','You do not have permission to migrate Facebook Events settings to Event Aggregator'=>'У вас нет разрешения на перенос настроек Facebook Events в Event Aggregator','You do not have permission to migrate iCal Importer settings to Event Aggregator'=>'У вас нет разрешения на перенос настроек iCal Importer в Event Aggregator','Your import must include at least one event'=>'Ваш импорт должен включать как минимум одно мероприятие','Your preview doesn\'t have any records to import.'=>'В вашем предварительном просмотре нет записей для импорта.','Your preview is taking a bit longer than expected, but it <i>is</i> still being generated.'=>'Ваш предварительный просмотр занимает немного больше времени, чем ожидалось, но он <i>еще</i> создается.','Unable to find a matching post.'=>'Не удалось найти соответствующую запись.','Unable to find an event with the ID of %s.'=>'Невозможно найти мероприятие с ID %s.','Unable to find an import record with the ID of %s.'=>'Невозможно найти запись импорта с ID %s.','Unable to get a post of the correct type.'=>'Невозможно получить запись нужного типа.','Unable to save scheduled import instance. Please try again.'=>'Невозможно сохранить экземпляр запланированного импорта. Попробуйте еще раз.','Unable to save scheduled import. Please try again.'=>'Невозможно сохранить запланированный импорт. Попробуйте еще раз.','We did not find any Facebook Events settings to migrate.'=>'Мы не нашли никаких настроек Facebook Events для переноса.','We did not find any iCal Importer settings to migrate.'=>'Мы не нашли никаких настроек iCal Importer для переноса.','The records you were attempting to import were still not available when this queue was processed. Please try again.'=>'Записи, которые вы пытались импортировать, были недоступны на момент обработки этой очереди. Попробуйте еще раз.','Migrate iCal Importer settings'=>'Перенос параметров настройки iCal Importer','An invalid frequency was used when trying to create this scheduled import.'=>'При попытке создать запланированный импорт использовалась недопустимая периодичность.','Only scheduled import records can be edited.'=>'Можно редактировать только запланированные записи импорта.','The import record is missing the origin.'=>'В записи импорта отсутствует происхождение.','You must map columns from the CSV file to specific fields in order to perform a CSV import.'=>'Для выполнения импорта CSV необходимо сопоставить столбцы из файла CSV с определенными полями.','The Event Aggregator API responded with bad data. Please <a href="https://theeventscalendar.com/support/post/" target="_blank">contact support</a>.'=>'API Event Aggregator ответил неверными данными. Пожалуйста, <a href="https://theeventscalendar.com/support/post/" target="_blank">обратитесь в службу поддержки</a>.','There may be an issue with the Event Aggregator server. Please try your import again later.'=>'Возможно, возникла проблема с сервером Event Aggregator. Повторите попытку импорта позже.','You must enter an Event Aggregator license key in Events > Settings > Licenses before using this service.'=>'Перед использованием этой службы необходимо ввести лицензионный ключ Event Aggregator в разделе Мероприятия > Настройки > Лицензии.','%s Event count in admin listAll %s'=>'Всего: %s','CSV File'=>'Файл CSV','aggregator schedule frequencyEvery 15 minutes'=>'Каждые 15 минут','aggregator schedule frequencyMonthly'=>'Ежемесячно','aggregator schedule frequencyWeekly'=>'Еженедельно','aggregator schedule frequencyDaily'=>'Ежедневно','aggregator schedule frequencyHourly'=>'Каждый час','aggregator schedule frequencyEvery 30 Minutes'=>'Каждые 30 минут','During scheduled import, the limit of HTTP requests was reached and the import was rescheduled.'=>'Во время запланированного импорта был достигнут лимит HTTP-запросов, и импорт был перенесен.','Each paid add-on has its own unique license key. Paste the key into its appropriate field below, and give it a moment to validate. You know you\'re set when a green expiration date appears alongside a "valid" message. Then click Save Changes.'=>'Каждое платное дополнение имеет свой уникальный лицензионный ключ. Вставьте ключ в соответствующее поле ниже и дайте ему время на проверку. Вы будете знать, что все готово, когда рядом с сообщением "Действителен" появится зеленый срок действия. Затем нажмите кнопку Сохранить изменения.','iCalendar'=>'iCalendar','ICS File'=>'Файл ICS','Meetup'=>'Meetup','aggregator schedule frequencyOn Demand'=>'По запросу','An invalid import type was used when trying to create this import record.'=>'При попытке создать эту запись импорта был использован недопустимый тип импорта.','Invalid data provided for CSV import.'=>'Неверные данные, предоставленные для импорта CSV.','The daily limit of %d import requests to the Event Aggregator service has been reached. Please try again later.'=>'Достигнут суточный лимит в %d запросов на импорт в службу Event Aggregator. Повторите попытку позже.','You do not have permission to delete this record.'=>'У вас нет разрешения на удаление этой записи.','You cannot delete a history record (ID: "%d"). '=>'Вы не можете удалить запись истории (ID: "%d"). ','The image associated with your event could not be attached to the event.'=>'Изображение, связанное с вашим мероприятием, не удалось прикрепить к мероприятию.','You must provide a valid CSV file to perform a CSV import.'=>'Для выполнения импорта CSV необходимо предоставить действительный CSV-файл.','Event Log'=>'Журнал мероприятий','The details of your calendar plugin and settings is often needed for you or our staff to help troubleshoot an issue. Please opt-in below to automatically share your system information with our support team. This will allow us to assist you faster if you post in our help desk.'=>'Подробная информация о вашем плагине календаря и его настройках часто необходимы вам или нашим сотрудникам, чтобы помочь в устранении проблемы. Пожалуйста, зарегистрируйтесь ниже, чтобы автоматически делиться информацией о вашей системе с нашей 