ленного местоположения ваше мероприятие не будет отображаться в результатах поиска в %sРасширенном сниппете Google%s.','Keep the Core Plugin %sFREE%s!'=>'Оставьте основной плагин %s БЕСПЛАТНЫМ%s!','It appears as if the tribe-common libraries cannot be found! The directory should be in the "common/" directory in the events calendar plugin.'=>'Похоже, что библиотеки tribe-common не могут быть найдены! Эта директория должна быть в директории "common/" в плагине Events Calendar.','open-source forum on WordPress.org'=>'открытый форум на WordPress.org','If you have tried the above steps and are still having trouble, you can post a new thread to our %s. Our support staff monitors these forums once a week and would be happy to assist you there.'=>'Если вы уже попробовали выше написанное и это вам не помогло, вы можете написать новое сообщение на нашем %s. Наша команда поддержки просматривает форумы раз в неделю и будет рада вам помочь.','<strong>Looking for more immediate support?</strong> We offer %1$s with the purchase of any of our premium plugins (like %2$s). Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays.'=>'<strong>Нужна поддержка?</strong> Мы предлагаем %1$s при покупке любого нашего премиум плагина (например %2$s). Приобретите лицензию и вы сможете отправлять сообщения, на которые получите ответ в течении 24-48 часов в рабочие дни.','<strong>Looking for more immediate support?</strong> We offer %s with the purchase of any of our premium plugins. Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays'=>'<strong>Нужна поддержка?</strong> ы предлагаем %s при покупке любого нашего премиум плагина. Приобретите лицензию и вы сможете отправлять сообщения, на которые получите ответ в течении 24-48 часов в рабочие дни','post a thread'=>'опубликовать тему','premium support on our website'=>'премиум поддержка на нашем веб-сайте','Troubleshooting common problems'=>'Разрешение типичных проблем','%s: An overview of the default templates and styles that are included in the plugin, as well as how to change them.'=>'%s: Обзор стандартных шаблонов и стилей, включенных в плагин, а так же информация о том, как их менять.','Using stylesheets and page templates'=>'Использование таблиц стилей и шаблонов страниц','%s: Do you see an issue with your calendar? Go here first to find where it’s coming from and how to fix it.'=>'%s: У вас проблема с календарем? Посмотрите сначала здесь, чтобы узнать из-за чего она и как её исправить.','%s: Code and guides for customizing your calendar in useful and interesting ways.'=>'%s: Исходный код и инструкции по настройке календаря в интересном и удобном виде.','Events Tickets'=>'Билеты на мероприятие','Customizing the Events plugins'=>'Настройка плагинов Events','If you have tried the above steps and are still having trouble, you can post a new thread to our WordPress.org forums for %1$s or %2$s. Our support staff monitors these forums once a week and would be happy to assist you there. '=>'Если вы уже попробовали выше написанное и это вам не помогло, вы можете написать новое сообщение на нашем форуме на WordPress.org для %1$s или %2$s. Наша команда поддержки просматривает форумы раз в неделю и будет рада вам помочь. ','Features overview'=>'Обзор функций','Settings overview'=>'Обзор настроек','New User Primer'=>'Первые шаги','CSV Import Settings'=>'Настройки импорта CSV','We are committed to helping make your calendar spectacular and have a wealth of resources available, including a handy %s to get your calendar up and running.'=>'Мы стремимся помочь сделать ваш календарь впечатляющим, и у нас есть множество доступных ресурсов, включая удобные %s для установки и запуска вашего календаря.','%s: Our most comprehensive outline for customizing the calendar to suit your needs, including custom layouts and styles.'=>'%s: Наш наиболее полный план настройки календаря в соответствии с вашими потребностями, включая пользовательские макеты и стили.','%s: A complete look at the features you can expect to see right out of the box as well as how to use them.'=>'%s: Полный обзор функций, которые вы можете ожидать увидеть прямо из коробки, а также руководство по их использованию.','Support for The Events Calendar'=>'Поддержка Events Calendar','%s: A thorough walkthrough of The Events Calendar and the settings that are available to you.'=>'%s: подробное пошаговое руководство по Events Calendar и настройкам, которые вам доступны.','Clear'=>'Очистить','Unnamed %s'=>'Без названия %s','Create New %s'=>'Создать новое %s','Add another %s'=>'Добавить еще %s','Read more about our support policy'=>'Прочитайте больше о наших правилах поддержки','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Пожалуйста, обратите внимание, что вся поддержка предоставляется через справочную службу. Вы можете написать нам по электронной почте или в твиттере… ​но мы, вероятно, направим вас обратно в службу поддержки 😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Существует очень мало проблем, с которыми мы не сталкивались, и, скорее всего, другой пользователь уже задал ваш вопрос и получил ответ от наших сотрудников службы поддержки. Хотя сообщения в службу поддержки могут оставлять только платные клиенты, они открыты для поиска и просмотра всеми желающими.','Test for a theme or plugin conflict'=>'Проверить на конфликт с темами или плагинами','Check our Knowledgebase'=>'Проверьте нашу Базу Знаний','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Тестирование на наличие существующего конфликта-лучшее начало для полного устранения неполадок. Мы часто просим вас выполнить эти действия при открытии новой темы, поэтому сделать это заранее будет очень полезно.','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Все распространенные (и не очень) ответы на вопросы, которые мы видим, находятся здесь. Это часто самый быстрый путь к поиску ответа!','Knowledgebase'=>'База знаний','Getting More Help'=>'Получить дополнительную помощь','list of available functions'=>'список доступных функций','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Хотя ресурсы, указанные выше, помогают решить большинство проблем, бывают времена, когда вам может потребоваться дополнительная поддержка. Если вам нужна помощь в использовании наших плагинов, и вы хотите, чтобы мы взглянули на проблему, пожалуйста, выполните следующие шаги:','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'Наш веб-сайт %s - отличное место для поиска советов и рекомендаций по использованию и настройке наших плагинов.','Getting Support'=>'Получить поддержку','Thank you for using %s! All of us at The Events Calendar sincerely appreciate your support and we’re excited to see you using our plugins.'=>'Спасибо вам за использование %s! Все мы в Events Calendar искренне ценим вашу поддержку, и мы рады видеть, что вы используете наши плагины.','Visit the Add-on Page'=>'Посетить страницу дополнений','Rating:'=>'Рейтинг:','Active Users:'=>'Активных пользователей:','Install Plugin'=>'Установить плагин','Thanks for setting up a valid key. It will expire on %s'=>'Спасибо за установку правильного ключа, он истекает %s','Plugin Active'=>'Плагин активен','Plugin Inactive'=>'Плагин неактивен','Upgrade Plugin'=>'Обновить плагин','Install %s'=>'Установить %s','Activate Plugin'=>'Активировать плагин','Activate %s'=>'Активировать %s',' and '=>' и ','Facebook Events'=>'Мероприятия Facebook','Turbo charge your posts admin for any custom post type with sortable filters and columns, and auto-registration of metaboxes.'=>'Турбо зарядка ваших сообщений администратора для любого пользовательского типа сообщений с помощью сортируемых фильтров и столбцов, а также автоматической регистрации метабоксов.','Events Tickets is a carefully crafted, extensible plugin that lets you easily sell tickets for your events.'=>'Events Tickets - это тщательно разработанный, расширяемый плагин, который позволяет легко продавать билеты на ваши мероприятия.','Event Tickets'=>'Event Tickets','Community Tickets'=>'Билеты сообщества','Event Tickets Plus'=>'Event Tickets Plus','Advanced Post Manager'=>'Расширенный менеджер почты','Eventbrite Tickets'=>'Eventbrite Tickets (билеты)','The Events Calendar is a carefully crafted, extensible plugin that lets you easily share your events.'=>'Events Calendar – тщательно продуманный расширяемый плагин, который позволяет легко делиться информацией о мероприятиях.','organizers'=>'организаторы','Completed!'=>'Завершено!','Event ID'=>'ID мероприятия','Cancel'=>'Отмена','%s must be a positive number or percent.'=>'%s должны быть указаны положительные числа или проценты.','%1$s or %2$s'=>'%1$s или %2$s','More...'=>'Больше...','Latest Version:'=>'Последняя версия:','Requires:'=>'Требуется:','WordPress '=>'WordPress ','News and Tutorials'=>'Новости и инструкции','Network Settings'=>'Настройки сети','Hide the following settings tabs on every site:'=>'Скрыть следующие вкладки настроек на каждом сайте:','City:'=>'Город:','Country:'=>'Страна:','Postal Code:'=>'Почтовый индекс:','Details'=>'Подробности','%s:'=>'%s:','Loading %s'=>'Загрузка %s','Import complete!'=>'Импорт завершен!','Default currency symbol'=>'Сим